import React from "react";
import CardItem from "./CardItem";

function Cards() {
  return (
    <div className="card">
      <h1>Check this out!</h1>
      <div className="card-container">
        <div className="card-wrapper">
          <ul className="card-item">
            <CardItem src="images/img-9.jpg" />
          </ul>
        </div>
      </div>
    </div>
  );
}

export default Cards;
